            <h2>What is an Expert Witness?</h2>
            <br />
            <p>An expert witness is a person considered to possess vast knowledge, understanding, and experience, in a given field that is called upon by the courts to give their opinion on a topic and / or incident.</p>
            <br />
            <p>The National Dog Trainers Federation has access to many consultants, some of whom are qualified to act as expert witnesses on a wide variety of canine related issues. These expert consultants are available to help you with:</p>
