            <p>In these terrible circumstances, the human victim, the owner of the canine (or other animal) victim or the child’s parents, contacts the police or the local council and the burden is generally on the owner of the ‘canine offender’ to provide proof of their dogs innocence.</p>
            <br />
            <p>In some instances, the victim will be satisfied if they are assured that you are intending to take relevant steps towards rectifying your dogs inappropriate behaviour. In other cases, the parties involved are less amenable and litigation and/or criminal charges become a real possibility.</p>
